// --- src/pages/Admin/AdminDashboard.js ---
import React from 'react';
import { Link } from 'react-router-dom';
import { Container, Typography, Box, Button, Paper } from '@mui/material';

export default function AdminDashboard() {
    return (
        <Container maxWidth="md" sx={{ mt: 4 }}>
            <Paper elevation={3} sx={{ p: 3 }}>
                <Typography variant="h4" component="h1" gutterBottom>
                    Admin Dashboard
                </Typography>
                <Typography variant="body1" paragraph>
                    Welcome to the Admin Portal. Use the options below to manage the banking system.
                </Typography>
                <Box sx={{ mt: 3 }}>
                    <Button
                        component={Link}
                        to="/admin/pending"
                        variant="contained"
                        color="primary"
                        sx={{ mr: 2 }}
                    >
                        View Pending Registrations
                    </Button>
                    {/* Add links to other admin functions here */}
                     <Button
                        component={Link}
                        to="/admin/customers" // Example: Link to manage all customers
                        variant="outlined"
                        color="secondary"
                     >
                        Manage All Customers (Future)
                     </Button>
                     <Button
                        component={Link}
                        to="/admin/create-employee" // Example: Link to create employee/admin users
                        variant="outlined"
                        color="secondary"
                        sx={{ ml: 2 }}
                     >
                        Create Employee/Admin (Future)
                     </Button>
                </Box>
            </Paper>
        </Container>
    );
}
